"""# Visualização de Dados

---

Vamos voltar a falar de visualização de dados em gráficos, desta vez focado na matplotlib, que é uma das bibliotecas do ecossistema da SciPy.

![image.png](data:image/png;base64,)

## Introdução

---

Considere uma linha numérica. Inteiros entre –3 e 3 são marcados na linha, mas entre qualquer dois números (digamos, 1 e 2) estão todos os números reais entre eles: 1.1, 1.2, 1.3 e assim por diante.

![image.png](data:image/png;base64,)

A linha numérica torna certas propriedades visualmente intuitivas. Por exemplo: Todos os números no lado direito de 0 são positivos e os do lado esquerdo são negativos; quando um número a está no lado direito de outro número b, a é sempre maior que b e b é sempre menor que a. 

As setas no final da linha numérica indicam que a linha se estende infinitamente, e qualquer ponto nesta linha corresponde a algum número real, não importa quão grande seja. Um único número é suficiente para descrever um ponto na linha.

Agora considere duas linhas numéricas cruzadas. As linhas numéricas se cruzam em um ângulo reto e no ponto de origem 0 de cada linha. Isso forma um plano de coordenadas cartesianas, com a linha numérica horizontal denominada eixo x e a linha vertical denominada eixo y.

![image.png](data:image/png;base64,)

Como na linha numérica, podemos ter infinitos pontos no plano. Descrevemos um ponto com um par de números, ao invés de um único número. Por exemplo, descrevemos o ponto A na figura com dois números, x e  y, geralmente escritos como (x, y), referidos como as coordenadas do ponto. 

Nesse caso x é a distância do ponto da origem ao longo o eixo x, y é a distância ao longo do eixo y. O ponto de intersecção dos eixos é chamada de origem e possui as coordenadas (0, 0). O plano de coordenadas cartesianas nos permite visualizar a relação entre dois conjuntos de números. 

Não importa quais são os dois conjuntos de números - temperatura, notas de beisebol ou notas de prova. Podemos, você pode plotá-los – podemos representa-lo em um gráfico, seja em papel ou em um programa escrito em Python.

## Matplotlib

---

Agora estamos prontos para criar nosso primeiro gráfico. Vamos começar com um gráfico simples com apenas três pontos: (1, 2), (2, 4) e (3, 6). Para criar este gráfico, primeiro faça duas listas de números - uma armazenando os valores das coordenadas x desses pontos e outro armazenando as coordenadas y. As duas declarações a seguir fazem exatamente isso, criando as duas listas x_numeros e y_números.
"""

x_numeros = [1, 2, 3]
y_numeros = [2, 4, 6]

plt.plot(x_numeros, y_numeros)
plt.show()

"""Então podemos criar o plot:"""

x_numeros = range(1, 11) 
y_numeros = [5, 5, 7, 6, 5, 4, 8, 10, 11, 12]

plt.scatter(x_numeros, y_numeros)
plt.show()

"""O primeiro argumento para a função `plot()` é a lista de números que queremos do eixo x, e o segundo argumento é o correspondente lista de números que queremos plotar no eixo y. 

A função `plot()` retorna um objeto (mais precisamente, uma lista que contém um objeto). Este objeto contém as informações sobre o gráfico que pedimos ao Python para criar. 

Para exebir o gráfico nós precisamos chamar a função `show()`.

### Marcando pontos no gráfico

---

Se você deseja que o gráfico marque os pontos que você forneceu para plotagem, podemos adicionar um parâmetro opcional ao chamar a função `plot()`:
"""

x_numeros = np.array([1, 2, 3, 4, 5, 6])
y_numeros = np.array([1, 2, 4, 8, 16, 32])

plt.plot(x_numeros, y_numeros, marker="P")
plt.show()

"""Ao inserir `marker = 'o'`, dizemos ao Python para marcar cada ponto de nossas listas com um pequeno círculo. Depois de inserir `show()` novamente, vemos que cada ponto é marcado com um ponto

Você pode escolher entre várias opções de marcador, incluindo 'o', '*', 'x' e '+'. Usando marker= inclui uma linha conectando os pontos (esse é o padrão).

Você também pode fazer um gráfico que marque somente os pontos que você especificou, sem nenhuma linha conectando-os, omitindo marker=.
"""

x_numeros = range(1, 11) 
y_numeros = [5, 5, 7, 6, 5, 4, 8, 10, 11, 12]

plt.plot(x_numeros, y_numeros, "*")
plt.show()

"""### Intervalo

---

Vamos dar uma olhada em um conjunto de dados um pouco maior para que possamos explorar mais recursos de matplotlib. 

As temperaturas médias anuais para a cidade de Nova York durante os anos de 2000 a 2012 são os seguintes: 53,9, 56,3, 56,4, 53,4, 54,5, 55,8, 56,8, 55,0, 55,3, 54,0, 56,7, 56,4 e 57,3 graus Fahrenheit. 

No momento, isso parece uma confusão de números, mas podemos traçar esse conjunto de temperaturas em um gráfico:
"""

nyc_temp = [53.9, 56.3, 56.4, 53.4, 54.5, 55.8, 56.8, 55.0, 55.3, 54.0, 56.7, 56.4, 57.3] 

plt.plot(nyc_temp)
plt.show()

"""Armazenamos as temperaturas médias em uma lista, `nyc_temp`. Então, chamamos o função `plot()` passando apenas esta lista (e a string do marcador). 

Quando você use `plot()` em uma única lista, esses números são automaticamente plotados no eixo y. Os valores correspondentes no eixo x são preenchidos como as posições de cada valor na lista. Ou seja, o primeiro valor da temperatura, 53,9, obtém uma correspondente valor do eixo x de 0 porque está na posição 0 da lista. 

Como resultado, os números plotados no eixo x são os inteiros de 0 a 12, que podemos pensar em como correspondente aos 13 anos para os quais temos dados de temperatura.

Traçar a temperatura sem mostrar os anos correspondentes é uma maneira rápida e fácil de visualizar as variações entre os anos. Se você fosse planeja apresentar este gráfico a alguém, no entanto, pode deixar ele mais claro, mostrando a que ano cada temperatura corresponde. Podemos fazer isso facilmente, criando outra lista com os anos e depois chamando a função `plot()`
"""

nyc_temp = [53.9, 56.3, 56.4, 53.4, 54.5, 55.8, 56.8, 55.0, 55.3, 54.0, 56.7, 56.4, 57.3] 
anos = range(2000, 2013) 
plt.plot(anos, nyc_temp, marker='o') 
plt.show()

"""O gráfico mostra que a temperatura média aumentou e diminuiu a partir do ano para o ano. Se você olhar para os números que traçamos, eles realmente não são muito distantes um do outro. No entanto, o gráfico faz as variações parecerem bastante dramáticas. Então o que está acontecendo? 

A razão é que o matplotlib escolhe o intervalo do eixo y, para que seja apenas o suficiente para incluir os dados fornecidos para plotagem. Portanto, neste gráfico, o eixo y começa em 53,0 e seu valor mais alto é 57,5. Isso faz com que pequenas diferenças pareçam ampliadas porque o intervalo do eixo y é pequeno. 

Podemos ajustar o intervalo dos eixos usando a função `axis()`. Esta função pode ser usada para recuperar o intervalo atual e também para definir um novo intervalo para os eixos.
"""

nyc_temp = [53.9, 56.3, 56.4, 53.4, 54.5, 55.8, 56.8, 55.0, 55.3, 54.0, 56.7, 56.4, 57.3] 
anos = range(2000, 2013)

plt.axis(ymax=80, ymin=30)
plt.plot(anos, nyc_temp, marker='o', color='green')

plt.show()

