"""## Exemplo

---

De acordo com a lei da gravitação universal de Newton, um corpo de massa 𝑚_1 atrai outro corpo de massa 𝑚_2 com uma quantidade de força F de acordo com a fórmula: `𝐹=(𝐺 𝑚_1 𝑚_2)/𝑟^2` 

Onde r é a distância entre os dois corpos e G é a constante gravitacional. Queremos ver o que acontece com a força enquanto a distância entre os dois corpos aumenta. 

Vamos pegar as massas de dois corpos: a massa do primeiro corpo (𝑚_1) é 0,5 kg, e a massa do segundo corpo (𝑚_2) é de 1,5 kg. O valor da constante gravitacional é 6.674 ×10^(−11)  𝑁𝑚^2 〖𝑘𝑔〗^(−2). 

Agora estamos prontos para calcular o força gravitacional entre esses dois corpos a 19 distâncias diferentes: 100m, 150m, 200m, 250m, 300m e assim por diante até 1000m. O seguinte programa executa esses cálculos e também desenha o gráfico:
"""

def desenhar_grafico(x, y): 
  plt.plot(x, y, marker='o') 
  plt.xlabel('Distância em metros') 
  plt.ylabel('Força em newtons') 
  plt.title('Força e distância') 
  plt.show()

def gerarFuncao():
  r = range(100, 1001, 50) 
  F = [] 
  G = 6.674*(10**-11) 
  m1 = 0.5 
  m2 = 1.5 
  for dist in r: 
    force = G*(m1*m2)/(dist * dist) 
    F.append(force) 
  
  desenhar_grafico(r, F) 

gerarFuncao()

